import React, { Component } from "react";
import { Navbar, NavbarBrand, Nav, NavItem } from "reactstrap";
import ModalItem from "./ModalItem";

class RadioNav extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="navigation">
        <Navbar color="faded" light>
          <NavbarBrand className="mr-auto">RadioChat</NavbarBrand>
          <Nav>
            <NavItem className="nav-items">
              <ModalItem
                btnText="Change Name"
                title="Enter new name: "
                handleClick={this.props.handleNameChange}
              />
            </NavItem>
            <NavItem className="nav-items">
              <ModalItem
                btnText="Create Room"
                title="Enter room name:"
                handleClick={this.props.handleRoomCreation}
              />
            </NavItem>
            <NavItem className="nav-items">
              <ModalItem
                btnText="Chat Radius"
                title="Set chat radius (miles): "
                isRange={true}
                setChatRadius={this.props.setChatRadius}
              />
            </NavItem>
          </Nav>
        </Navbar>
      </div>
    );
  }
}

export default RadioNav;
